            background-position: center;
            opacity: 0.6;
            z-index: 0;

        /* Dark overlay */
        body::after {
            content: '';
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(180deg, 
                rgba(0,0,0,0.35) 0%, 
                rgba(0,0,0,0.25) 50%, 
                rgba(0,0,0,0.45) 100%
            );
            z-index: 1;
        }
        
        .container {
            position: relative;
            z-index: 2;
            text-align: center;
            padding: 30px 20px;
            max-width: 900px;
            width: 100%;
            margin-top: 0;
        }
        
        .logo {
            max-width: 380px;
            width: 80%;
            margin: 20px auto 30px;
            filter: drop-shadow(0 8px 30px rgba(255, 255, 255, 0.5));
            animation: logoFloat 3s ease-in-out infinite;
        }
        
        @keyframes logoFloat {
            0%, 100% { 
                transform: translateY(0px);
            }
            50% { 
                transform: translateY(-8px);
            }
        }
        
        .menu-buttons {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
            gap: 25px;
            margin: 30px auto 40px;
            max-width: 750px;
        }
        
        .menu-btn {
            display: block;
            padding: 45px 35px;
            background: rgba(255, 255, 255, 0.3);
            backdrop-filter: blur(20px);
            border: 3px solid rgba(255, 255, 255, 0.7);
            border-radius: 22px;
            text-decoration: none;
            transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
            box-shadow: 0 8px 35px rgba(0, 0, 0, 0.7), 
                        0 0 40px rgba(255, 255, 255, 0.15);
            position: relative;
            overflow: hidden;
        }
        
        .menu-btn::before {
            content: '';
            position: absolute;
            top: 0;
            left: -100%;
            width: 100%;
            height: 100%;
            background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.4), transparent);
            transition: left 0.6s;
        }
        
        .menu-btn:hover::before {
            left: 100%;
        }
        
        .menu-btn:hover {
            transform: translateY(-10px) scale(1.05);
            background: rgba(255, 255, 255, 0.4);
            border-color: rgba(255, 255, 255, 0.95);
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.8),
                        0 0 60px rgba(255, 255, 255, 0.3);
        }
        
        .menu-icon {
            font-size: 4.5rem;
            margin-bottom: 15px;
            display: block;
            filter: drop-shadow(0 5px 15px rgba(0,0,0,0.8));
        }
        
        .menu-title {
            font-family: 'Bebas Neue', sans-serif;
            font-size: 3.2rem;
            color: #ffffff;
            letter-spacing: 3px;
            margin-bottom: 8px;
            text-shadow: 0 4px 15px rgba(0,0,0,0.95),
                         0 0 25px rgba(255,255,255,0.4);
            font-weight: 700;
        }
        
        .menu-desc {
            color: rgba(255, 255, 255, 0.98);
            font-size: 1.05rem;
            font-weight: 500;
            text-shadow: 0 3px 10px rgba(0,0,0,0.95);
        }
        
        .footer-info {
            margin-top: 50px;
            color: rgba(255, 255, 255, 0.88);
            font-size: 0.95rem;
            line-height: 1.9;
            text-shadow: 0 2px 10px rgba(0,0,0,0.95);
            background: rgba(0, 0, 0, 0.45);
            padding: 20px;
            border-radius: 15px;
            backdrop-filter: blur(12px);
        }
        
        .footer-info a {
            color: rgba(255, 255, 255, 0.98);
            text-decoration: none;
            transition: all 0.3s;
            border-bottom: 1px solid rgba(255, 255, 255, 0.6);
            font-weight: 600;
        }
        
        .footer-info a:hover {
            color: #ffffff;
            border-bottom-color: #ffffff;
            text-shadow: 0 0 10px rgba(255,255,255,0.6);
        }
        
        @media (max-width: 768px) {
            .container {
                padding: 20px 15px;
            }
            
            .logo {
                max-width: 260px;
                margin: 15px auto 25px;
            }
            
            .menu-buttons {
                grid-template-columns: 1fr;
                gap: 20px;
                margin: 25px auto 30px;
            }
            
            .menu-btn {
                padding: 38px 28px;
            }
            
            .menu-icon {
                font-size: 3.8rem;
            }
            
            .menu-title {
                font-size: 2.3rem;
            }
            
            .menu-desc {
                font-size: 0.95rem;
            }
            
            .footer-info {
                margin-top: 35px;
                font-size: 0.88rem;
            }
        }
    
        /* Club de Amigos Button */
        .club-btn {
            display: inline-block;
            margin: 25px auto 40px;
            padding: 20px 50px;
            background: linear-gradient(135deg, #FFD700, #FFA500);
            border: 3px solid #FFD700;
            border-radius: 50px;
            text-decoration: none;
            color: #000000;
            font-family: 'Bebas Neue', sans-serif;
            font-size: 1.8rem;
            letter-spacing: 2px;
            font-weight: 700;
            box-shadow: 0 10px 40px rgba(255, 215, 0, 0.5),
                        0 0 30px rgba(255, 215, 0, 0.3);
            transition: all 0.4s;
            animation: pulse 2s ease-in-out infinite;
        }
        
        .club-btn:hover {
            transform: translateY(-5px) scale(1.05);
            background: linear-gradient(135deg, #FFA500, #FFD700);
            box-shadow: 0 15px 60px rgba(255, 215, 0, 0.7),
                        0 0 50px rgba(255, 215, 0, 0.5);
        }
        
        @keyframes pulse {
            0%, 100% {
                box-shadow: 0 10px 40px rgba(255, 215, 0, 0.5),
                            0 0 30px rgba(255, 215, 0, 0.3);
            }
            50% {
                box-shadow: 0 10px 40px rgba(255, 215, 0, 0.7),
                            0 0 50px rgba(255, 215, 0, 0.5);
            }
        }
        
        .club-icon {
            font-size: 1.5rem;
            margin-right: 10px;
        }
        
    </style>
</head>
